column59:
Consultant will provide the following Services throughout the State of Texas in support of legislative
implementation for 2024 and extending partnerships across the state, and as otherwise directed by Client,
including, but not limited to:
• Legislative and Executive Branch outreach for 2025 session;
• Executive department (agency) engagement in rule making processes stemming from the 2023
legislative session;
• In coordination with Client, develop a strategy for outreach to, and connection with, municipal
leaders in the state (may include recommendation for other providers, associations, or organizations
through which Client can execute on strategy);
• Facilitate authorities connection with Chambers of Commerce and Economic Development.
